import { Injectable } from '@angular/core';

export interface Link{
  category: string;
  blacklistFlag: string[];
  type: string;

}

@Injectable({
  providedIn: 'root'
})
export class LinkService {

  linkDetail: Link = {
    category: 'programming',
    blacklistFlag: ['nsfw'],
    type: 'single'
}

  private privateLinks: Link[] = [];


  constructor() { }
}
